data.map(({ full_name, email, money }) => ({ full_name, email, money }));

// 4. email은 도메인만남기고, credit_card는 숫자의 합으로 바꾸고,
// money $ -> 원화로 바꾸고,
// url은 com까지만 남기기

data.map(({ email, credit_card, money, url }) => {
  const newEmail = email.split("@")[1].split(".")[0];
  const newMoney = Number(money.replace("$", "")) * 1386.5 + "Won";
  const domain = url.split("//")[1].split("/")[0];
  const newCredit = [...credit_card].reduce((a, c) => a + Number(c), 0);
  return {
    email: newEmail,
    credit_card: newCredit,
    money: newMoney,
    url: domain,
  };
});
